Library/css-modular/jss/docs/json-api.ht.body:
1. JSON API for declaring Style Sheets1.1. Regular Rule, without plugins1.2. Function values1.2.1. Support of "!important"1.3. Function rules1.4. Observable values1.5. Observable rules1.6. Media Queries1.6.1. ES6 with constants in prop names1.7. Keyframes Animation1.7.1. ES6 with generated keyframe id1.8. Fallbacks1.9. Font Face1.10. Alternative syntax for space and comma separated values1.10.1. Comma separated values1.10.2. Space separated values1.10.3. Modifier "!important"1.11. Writing global selectors1.12. Pseudo and Nested Selectors1.13. Property "content"1.14. Working with colors1.15. Plugins1. JSON API for declaring Style Sheets
JSS is designed to stay as close as possible to the CSS syntax, however there are some exceptions.
1.1. Regular Rule, without plugins
const styles = {
  button: {
    color: 'red',
    'font-size': '12px'
  }
}

Compiles to:
.button-jss-0 {
  color: red;
  font-size: 12px;
}

1.2. Function values
If you want dynamic behavior for your Style Sheet, you can use functions as a value which return the actual value. Use sheet.update(data) in order to pass the data object. Sheet option link: true is required for this to function.
const styles = {
  button: {
    color: data => data.color
  }
}

1.2.1. Support of "!important"
To use the !important modifier with function values, you must use array syntax:
const styles = {
  button: {
    color: data => [data.color, '!important']
  }
}

1.3. Function rules
Similar to function values, you can use a function to return a dynamic style object. Use sheet.update(data) in order to pass the data object. Sheet option link: true is required for this to function.
const styles = {
  button: (data) => ({
    position: 'flex',
    color: data.color
  })
}

1.4. Observable values
In order to create highly dynamic animations, you may want to use streams. Take a look at the tc39 observable proposal. Sheet option link: true is required for this to function.
const styles = {
  button: {
    color: new Observable((observer) => {
      observer.next('red')
    })
  }
}

1.5. Observable rules
Similar to observable values, you can declare observable rules. Stream should contain in this case the style object. Sheet option link: true is required for this to function.
const styles = {
  button: new Observable((observer) => {
    observer.next({
      color: 'red',
      opacity: 1
    })
  })
}

1.6. Media Queries
const styles = {
  button: {
    width: 100
  },
  '@media (min-width: 1024px)': {
    button: {
      width: 200
    }
  }
}

1.6.1. ES6 with constants in prop names
const minWidth = 1024

const styles = {
  button: {
    width: 100
  },
  [`@media (min-width: ${minWidth}px)`]: {
    button: {
      width: 200
    }
  }
}

Compiles to:
.button-jss-0 {
  width: 100px;
}
@media (min-width: 1024px): {
  .button-jss-0 {
    width: 200px;
  }
}

1.7. Keyframes Animation
Note: keyframe id is still global and may conflict.
const styles = {
  '@keyframes my-animation': {
    from: {opacity: 0},
    to: {opacity: 1}
  }
}

1.7.1. ES6 with generated keyframe id
const animationId = random()

const styles = {
  [`@keyframes ${animationId}`]: {
    from: {opacity: 0},
    to {opacity: 1}
  }
}

Compiles to:
@keyframes my-animation {
  from { opacity: 0; }
  to { opacity: 1; }
}

1.8. Fallbacks
const styles = {
  container: {
    background: 'linear-gradient(to right, red 0%, green 100%)'
    fallbacks: {
      background: 'red'
    }
  }
}

// Or if you need multiple fallbacks for the same property name:
const styles = {
  container: {
    display: 'flex'
    fallbacks: [
      {display: 'box'},
      {display: 'flex-box'}
    ]
  }
}

Compiles to:
.container--jss-0-0 {
  background: red;
  background: linear-gradient(to right, red 0%, green 100%);
}

1.9. Font Face
const styles = {
  '@font-face': {
    fontFamily: 'MyWebFont',
    src: 'url(webfont.eot)'
  }
}

Compiles to:
@font-face {
  font-family: 'MyWebFont';
  src: url('webfont.eot');
}

// Multiple font faces.
const styles = {
  '@font-face': [
    {
      fontFamily: 'MyWebFont',
      src: 'url(webfont.eot)'
    },
    {
      fontFamily: 'MySecondFont',
      src: 'url(webfont2.eot)'
    }
  ]
}

Compiles to:
@font-face {
  font-family: 'MyWebFont';
  src: url('webfont.eot');
}
@font-face {
  font-family: 'MySecondFont';
  src: url('webfont2.eot');
}

// Font-Face with src fallbacks.
const styles = {
  '@font-face': {
    fontFamily: 'MyWebFont',
    src: 'url(webfont.eot)',
    fallbacks: [
      {src: 'url(webfont.eot?#iefix) format(embedded-opentype)'},
      {src: 'url(webfont.woff2) format(woff2)'}
    ]
  }
}

Compiles to:
@font-face {
  font-family: 'MyWebFont';
  src: url('webfont.eot');
  src: url(webfont.eot?#iefix) format(embedded-opentype);
  src: url(webfont.woff2) format(woff2);
}

1.10. Alternative syntax for space and comma separated values
In order to describe space or comma separated CSS values in a JavaScript way, we introduced an array based syntax.
There are some advantages in using this syntax:

Plugin jss-default-unit is able to set default unit effectively for numeric values.
You can use variables inside of a value declaration without string templates or concatenations.

1.10.1. Comma separated values
const styles = {
  button: {
    // Comma separated value with regular CSS strings inside.
    border: [
      '1px solid red',
      '1px solid blue'
    ]
  }
}

Compiles to:
.button-12345 {
  border: 1px solid red, 1px solid blue;
}

const styles = {
  button: {
    // Comma separated value with space separated values inside.
    border: [
      // Numbers can become default unit automatically.
      [1, 'solid', 'red'],
      [1, 'solid', 'blue']
    ]
  }
}

Compiles to:
.button-12345 {
  border: 1px solid red, 1px solid blue;
}

1.10.2. Space separated values
const styles = {
  button: {
    // Space separated value.
    margin: [[5, 10]]
  }
}

Compiles to:
.button-12345 {
  margin: 5px 10px;
}

1.10.3. Modifier "!important"
const styles = {
  button: {
    color: ['red', '!important'],
    margin: [[5, 10], '!important']
  }
}

Compiles to:
.button-12345 {
  color: red !important;
  margin: 5px 10px !important;
}

1.11. Writing global selectors
Global selectors can be used when the jss-global plugin is installed.
1.12. Pseudo and Nested Selectors
Are supported through the jss-nested plugin.
1.13. Property "content"
When assigning a string to the content property it requires double or single quotes in CSS. Therefore you also have to provide the quotes within the value string for content to match how it will be represented in CSS.
const styles = {
  button: {
    '&:after': {
      content: '"JSS"'
    }
  }
}

Compiles to:
.button-jss-0-1:after {
  content: "JSS"
}

1.14. Working with colors
You can use any color conversion tool, for e.g. this one.
import color from 'color'

const styles = {
  button: {
    color: color('blue').darken(0.3).hex()
  }
}

Compiles to:
.button-jss-0-1 {
  color: '#0000B3'
}

1.15. Plugins
JSS plugins give you even more features, read about them.
